    // \u9690\u85cf\u67e5\u8be2\u6309\u94ae\n          actionVisible: false,\n          // \u6807\u7b7e\u5bf9\u9f50\u65b9\u5f0f\n          labelAlign: 'left'\n        }}\n        listExtend={{\n          grid: {\n            // \u7f51\u683c\u95f4\u7684\u8ddd\u79bb\n            gutter: 16,\n            // \u4e0d\u540c\u5206\u8fa8\u7387\u4e0b\u7684\u5361\u7247\u4e2a\u6570\n            xs: 1,\n            sm: 1,\n            md: 1,\n            lg: 2,\n            xl: 3,\n            xxl: 5\n          }\n        }}\n        pagination={{ pageSize: 20 }}\n        ref={listRef}\n        onParamsChange={(searchParams: AnyKeyProps) => {\n          // \u7ffb\u9875 & \u67e5\u8be2\u65f6\uff0c\u6eda\u52a8\u5230\u6700\u9876\u90e8\n          window.scrollTo({ behavior: 'smooth', top: 0 })\n          setSearchValue(searchParams)\n        }}\n        renderItem={(record: Record) => {\n          // \u5361\u7247\u6e32\u67d3\u5185\u5bb9\n          return (\n            <List.Item key={record.id}>\n              <Card cover={<Image alt=\"example\" height={200} src={record.cover} />} bodyStyle={{ padding: 12 }}>\n                <div>{record.name}</div>\n                <Space>\n                  <span className=\"price\">\n                    <span className=\"unit\">\xa5</span>\n                    {record.price}\n                  </span>\n                  <span className=\"sub\">{record.buyNum}\u4eba\u5df2\u8d2d\u4e70</span>\n                </Space>\n              </Card>\n            </List.Item>\n          )\n        }}\n      >\n        {/* \u67e5\u8be2\u533a\u57df\u8bbe\u7f6e */}\n        <AyFields>\n          <AyField\n            title=\"\u5546\u54c1\u540d\u79f0\"\n            key=\"keyword\"\n            search={{\n              type: 'search',\n              grid: block,\n              style: sizeStyle\n            }}\n          />\n          <AyField\n            title=\"\u5546\u54c1\u7c7b\u578b\"\n            key=\"goodsType\"\n            search={{\n              type: 'tag-group',\n              grid: block,\n              options: goodsTypeOptions,\n              onChange: reloadList\n            }}\n          />\n          <AyField\n            title=\"\u53d1\u8d27\u5730\u533a\"\n            key=\"goodsAddress\"\n            search={{\n              type: 'tag-group',\n              grid: block,\n              options: addressOptions,\n              multiple: true,\n              onChange: reloadList\n            }}\n          />\n          <AyField title=\"\u4ef7\u683c\u533a\u95f4\" key=\"__price\" search={{ grid: block }} type=\"input-group\">\n            <AyField key=\"min\" placeholder=\"\u6700\u4f4e\u4ef7\" className=\"price-input\" onBlur={reloadList} />\n            <AyField\n              key=\"__gap\"\n              render={() => (\n                <span key=\"gap\" className=\"price-gap\">\n                  ~\n                </span>\n              )}\n            />\n            <AyField key=\"max\" placeholder=\"\u6700\u9ad8\u4ef7\" className=\"price-input\" onBlur={reloadList} />\n          </AyField>\n          <AyField\n            title=\"\u9500\u552e\u65f6\u95f4\"\n            key=\"date\"\n            search={{ grid: block, style: sizeStyle, type: 'date-range', onChange: reloadList }}\n          />\n        </AyFields>\n      </AySearchList>\n      {/* \u9875\u9762\u6253\u5370\u7528\uff0c\u5b9e\u9645\u4f7f\u7528\u5220\u6389\u5373\u53ef */}\n      <Divider orientation=\"left\">\u67e5\u8be2\u53c2\u6570</Divider>\n      {Object.keys(searchValue).length && <pre>{JSON.stringify(searchValue, null, 2)}</pre>}\n    </div>\n  )\n}",V="import { Record, AnyKeyProps } from 'amiya'\n\n/**\n * \u83b7\u53d6\u968f\u673a\u6570\n * @param min \u6700\u5c0f\u968f\u673a\u6570\n * @param max \u6700\u5927\u968f\u673a\u6570\n */\nexport const getRandom = (min: number, max: number): number => {\n  return Math.floor(min + Math.random() * (max - min + 1))\n}\n\nconst data: Array<Record> = Array.from({ length: 100 }).map(item => {\n  